import './App.css';
import Header from './components/js/Header';
import Footer from './components/js/Footer';
import MainBoard from './components/js/MainBoard';

function App() {
  return (
    <div className="App">
      <Header/>
      <h1>Too Good To Go</h1>
      <MainBoard/>
      <Footer/>
    </div>
  );
}

export default App;
